import React from 'react';
import ReactDOM from 'react-dom';

/* 将表达式作为元素的属性 */
const url = "https://dss1.bdstatic.com/70cFvXSh_Q1YnxGkpoWK1HF6hhy/it/u=1009600391,1287960116&fm=26&gp=0.jpg";
const cls = "image";
const div = (
    <div>
        <img src={url} alt="哈士奇" className={cls}></img>
    </div>
);
ReactDOM.render(div, document.getElementById('root'));
